import React, { Component } from "react";
import "./main.css";
import { BrowserRouter, Route, Link } from "react-router-dom";
import temp1pic from "./temp1.png";
import temp2pic from "./temp2.jpg";
import temp3pic from "./temp3.jpg";
import temp4pic from "./temp4.jpg";
export default class SelectT extends Component {
  render() {
    return (
      <div className="App-header">
        <h1> Step 1: Choose a template..</h1>
        <div>
          <a href="/survey/template1">
            <img className="template_logo" src={temp1pic} />
          </a>

          <Link href="/survey/template2">
            <img className="template_logo" src={temp2pic} />
          </Link>
        </div>
        <div>
          <a href="/survey/template3">
            <img className="template_logo" src={temp3pic} />
          </a>
          <a href="/survey/template4">
            <img className="template_logo" src={temp4pic} />
          </a>
        </div>
      </div>
    );
  }
}
